import React, { useEffect, useState } from 'react';
import Layout from '../../Components/Layout/Layout';

const ModeltestUnit = (props) => {
    const [modeltests, setModeltests] = useState({});
    const [error, setError] = useState("");
    useEffect(async () => {
        try {
            const res = await axios.get(`http://localhost:4000/api/get/model-tests/${props.match.params.slug}/${props.match.params.unitId}`);
            setModeltests(res.data.modeltest);
        } catch (err) {
            setError("Something wrong!");
        }
    }, []);
    return (
        <Layout>
            <div className="mainDiv">
                {modeltests._id}
            </div>

        </Layout>
        
    );
};

export default ModeltestUnit;
